INSERT INTO `map_item` (`id`, `name`, `slug`, `description`, `latitude_illustration`, `longitude_illustration`, `latitude_satellite`, `longitude_satellite`, `created`, `updated`, `content_changed`, `discr`, `alias`, `admissions_tour`)
VALUES
	(1,'Welch Hall','welch-hall','You can sit by the beautiful fountain outside this red brick building on a nice, summer day. It house the main administrative offices and is one of four buildings on EMU\'s campus that is on the National Register of Historic Places.',74.1758987,-160.9895545,42.2459830,-83.6244740,'2018-03-20 16:02:11','2019-09-16 14:32:57',NULL,'building',NULL,0),
	(5,'AED, 2nd floor main corridor','2nd-floor-main-corridor',NULL,NULL,NULL,NULL,NULL,'2018-03-20 16:02:11','2018-07-13 15:29:23',NULL,'emergency',NULL,0),
	(9,'Rec/IM','rec-im','The REC/IM is where our students get their sweat on. Keep moving!',75.9941951,-135.6247251,42.2503130,-83.6249685,'2018-03-27 13:37:04','2020-07-02 15:58:37',NULL,'building','olds robb recreation and intramural recim rec im',0),
	(12,'Alexander Music Building','alexander-music-building','Random acts of singing and dancing happen here as home to the School of Music and Dance. Students also \"go global\" here learning about language and culture as it houses the Department of World Languages.\n\n',71.1043316,-125.4299990,42.2496538,-83.6202586,'2018-04-02 17:49:24','2019-09-16 14:38:38',NULL,'building','band building',0),
	(13,'Amphitheatre','amphitheatre','Circularly structured, there\'s no such thing as a bad seat in the house for the many outdoor activities and performances held here.',76.3361368,-124.7610704,42.2519450,-83.6253590,'2018-04-02 17:50:12','2019-09-16 16:51:19',NULL,'building',NULL,0),
	(14,'Best Hall','best-hall','Join our academic housing option here and take \"live and learn\" to a whole new level.\n',72.9845105,-123.1855995,42.2506560,-83.6214750,'2018-04-02 17:51:39','2019-09-16 14:39:58',NULL,'building',NULL,0),
	(15,'Boone Hall','boone-hall','Discover new ways to expand horizons in higher education here. Home to our Academic Programs Abroad office, you\'ll discover where EMU will take you. Birds of a feather flock together.',72.5225238,-157.0684420,42.2459830,-83.6228260,'2018-04-02 18:15:14','2019-09-16 16:50:36',NULL,'building',NULL,0),
	(16,'Bowen Field House','bowen-field-house','Endearingly known as \"The Old Barn\", you can catch a track, gymnastics meet, or wrestling match here. You might also find yourself taking a physical education course in this facility entering its 64th season of use.',76.2686617,-137.6330454,42.2501370,-83.6258930,'2018-04-02 18:15:36','2019-09-16 14:42:05',NULL,'building',NULL,0),
	(19,'Autism Collaborative Center and Children\'s Institute','autism-collaborative-center-and-childrens-institute','Fitting that it was originally an elementary school, this building is now home to a therapeutic learning environment for specialized education and training in autism. The Children\'s Institute, located in this building, serves as the on-campus early childhood education program for the children of EMU students, faculty, staff and the surrounding community.',80.9725548,-131.6210294,42.2540360,-83.6348720,'2018-04-02 18:27:04','2019-09-16 14:43:12',NULL,'building','Elizabeth Fletcher School acc',0),
	(20,'Briggs Hall','briggs-hall','Dedicated to the three-dimensional art department, this hall houses programs such as woodworking, metalsmithing, and furniture design.\n',75.1408367,-159.1847965,42.2468570,-83.6257630,'2018-04-02 18:28:02','2019-09-16 14:43:45',NULL,'building',NULL,0),
	(21,'Brown Apartments','brown-apartments','Right next to its sister apartments, Munson, and conveniently located between the library and REC/IM, Brown Apartments have several floor plan options for cozy, close-to-class living.\n',76.3034445,-145.6855995,42.2490770,-83.6263120,'2018-04-02 18:29:03','2019-09-16 14:44:11',NULL,'building',NULL,0),
	(22,'Buell Hall','buell-hall','Reserved for upperclassmen and transfer students, this residence hall surrounds The Commons dining area and offers residents a shared bathroom and living area.\n',74.2427821,-125.3351782,42.2510680,-83.6229250,'2018-04-02 18:29:38','2019-09-16 14:44:49',NULL,'building',NULL,0),
